import React, { Component, useEffect, useState } from "react";
import CustomerDataService from "../data/CustomerDataService"


function Profile(){
  
  const [profile, setProfile] = useState([]);  

  const fetchProfile = async () => {
    try{
      fetch('http://localhost:9000/api/accounts/helloThere', {
          "method": "POST",
          "headers": {
              "Content-Type": "application/json"
          },
          "body": JSON.stringify({
              username: username,
              password: pass,
              role: "ROLE_USER"
          })
      })
          .then(res => res.json())
          .then(data => {
              props.setUsers({...props.users, data});
              props.setCurrentUser({ username: username, pass: pass });
          })
      history.push("/");
  } catch (err) {
      console.error(err);
  }
  }

  
    useEffect(() =>{
      fetchProfile();
      console.log(profile + "hi");
    },[])
      
      return(
      
        <div className="container">
          <table className="table">
            <thead>
              <tr>
                <th>Customer Id</th>
                <th>Name</th>
                <th>UserName</th>
                <th>Password</th>
                <th>Phone #</th>
                <th>Email</th>
                <th>City</th>
              </tr>
          </thead>
          <tbody>
                
                <tr key={profile.customerId}>
                <td>{profile.customerName}</td>
                <td>{profile.userName}</td>
                <td>{profile.password}</td>
                <td>{profile.phone}</td>
                <td>{profile.email}</td>
                <td>{profile.city}</td>

                </tr>
              
            
          </tbody>
        </table>
        </div>
      )
    
  }

export default Profile;
